      <text id="104" justification="0" size="4" underlined="false">
        <text>&lt;b&gt;Work Project Queue;&lt;/b&gt;
Fabricate works on any number of projects individually
or in project dependency order.
&lt;br/&gt;
&lt;b&gt;This includes all projects;&lt;/b&gt;
When fab is run in a directory with fabricate.xml
&lt;br/&gt;
&lt;b&gt;The current project;&lt;/b&gt;
When fab is run in a directory with a project.xml file.
&lt;br/&gt;
&lt;b&gt;The current project and projects 
which depend on the current project;&lt;/b&gt;
When fab is run on a single project with;
&lt;b&gt;-r&lt;/b&gt; (ailas: &lt;b&gt;--rebuild-dependents&lt;/b&gt;)
&lt;br/&gt;
This allows the developer to work from any problem project 
location to one or more desired fabrication results.  This
inspires a organic work pattern when working with 
project dependency trees.   Project dependency trees 
ensure clean re-usable isolation and reduce
the amout of code (and therefore work) required in building 
large complex systems (i.e. Eclipse).   Project dependency
trees also provide a natural ordering for concurrent processing.   </text>
      </text>

      <text id="230" justification="0" size="4" underlined="false">
        <text>FabricateCommands and FabricateStages
are both implementations of I_FabricateRoutine.
They may run on the same thread or many threads.
The implementations determine how Fabricate 
executes them (I_ConcurrecyAware).  Fabricate provides 
some base classes to assist implementer namely;
&lt;b&gt;ProjectQueueRoutine&lt;/b&gt;
Which processes projects in any order concurrently.
&lt;b&gt;DependenciesQueueRoutine&lt;/b&gt;
Which processes projects in dependency order concurrently.

</text>

      <text id="266" justification="0" size="4" underlined="false">
        <text>&lt;b&gt;Fabrication;&lt;/b&gt;
Fabricate processes each build stage in the fabricate.xml
file order.  Build stages may do anything usually do 
something like;
Compile and Jar
Test
&lt;b&gt;Note&lt;/b&gt; Stages which run tests (trials) check for the following 
command line argument;
&lt;b&gt;-t&lt;/b&gt; (ailas: &lt;b&gt;--test&lt;/b&gt;)
&lt;br/&gt;
&lt;b&gt;Archival&lt;/b&gt;
&lt;b&gt;-a&lt;/b&gt; (ailas: &lt;b&gt;--archive&lt;/b&gt;)
If so Fabricate processes each archive stage in the fabricate.xml
file order. Archive stages are currently expected to include;
Create remote repository archive.
Publish build results to Intelligence4j.
Note archival to Intelligence4j could potentially have checks
that could cause fabrication to fail (i.e. insufficient code coverage)
&lt;br/&gt;
&lt;b&gt;Labels&lt;/b&gt;
&lt;b&gt;-m&lt;/b&gt; (ailas: &lt;b&gt;--mark-versions&lt;/b&gt;)
&lt;b&gt;-g&lt;/b&gt; (ailas: &lt;b&gt;--grow-branches&lt;/b&gt;)
Process labels creates tags or branches on the non project
group projects, using the project groups fabricate.xml 
version values.
&lt;br/&gt;
&lt;b&gt;Sharing&lt;/b&gt;
&lt;b&gt;-s&lt;/b&gt; (ailas: &lt;b&gt;--share&lt;/b&gt;)
This causes Fabricate to attempt to share the source code
back to the source control management system.
 (i.e. git commit and push)</text>
      </text>
